class Solution:
    def numSub(self, s: str) -> int:
        memo = [i for i in range(len(s)+1)]
        for i in range(1,len(memo)):
          memo[i] += memo[i-1]

        result = 0
        i = 0
        while i< len(s):
          k = 1
          if s[i] == '1':
            while i+k < len(s) and s[i+k] == '1':
              k += 1
            result += memo[k]
          i += k

        return result
